script: |
  super -f text -I q4453.spq | sort > q4453.out

inputs:
  - name: q4453.spq
    data: |
      SELECT DISTINCT + col0 * - col0 + - col0 * ( - ( cor0.col0 ) * col2 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q4453.out
    data: |
      1274
      152100
      230917
